import React, { useContext, useEffect } from 'react';
import { userContext } from '../../App';


const Child = () => {
    const { language, setLanguage} = useContext(userContext);

    useEffect(() =>{
        setLanguage("telugu")
    }, []);

    return (
        <div>
            {language}
        </div>
    )
}

export default Child;
